INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('76767807', 'Crunchy Muesli', 'NL/BE Krokante muesli met pure chocoladestukjes, amandelen en hazelnoten. Ingrediënten: 45% volkoren havervlokken, 11% pure chocoladestukjes (cacaomassa, suiker, boterconcentraat (melk), emulgator: lecithinen (zonnebloem)), suiker, palmolie, 7% mais - en rijstbolletjes (maisgries, tarwebloem, rijstgries, suiker, zout), glucosestroop, maisvlokken (maismecl, suiker ZOut, gerstemout, emulgator: lecithinen (Zonnebloem)), 4,1% tarwebloem, 2% amandel, 1% hazelnoot, oligoc gerstemoutextract, honing, naniur vanillearoma, zout, kaneel, natuury gekaramelliseerde suiker. Droge cacaobestanddelen in pure chocolades ten minste 64%. Kan sporen van soja en andere noten bevatten. Suggestie: de muesi is extra lekker met koude melk, yoghurt of kwark, of gewoon als tussendoortje. Aangezien dit een natuurproduct is, kan het ondanks zorgvuldige controle niet uitgesloten worden dat er kernen, pitten en schaaldelen in het product voorkomen. Kleine kinderen kunnen zich in noten verslikken. De voedingswaardes dit product zijn onderhevig aan de gebruikelijke schommelingen in natuurlijke producten. Vulhoogte technisch bepaald. Tegen warmte en vochtigheid beschermen. De zak na elk gebruik goed sluiten. Na openen binnen 1 maand consumeren. Ongeopend, ten minste houdbaar tot: zie bovenzijde. FR/BE Muesli croustillant aux pépites de chocolat noir, amandes et noisettes.', '', '', '', '', '', '', '', '', '', '', '1');

